import React from 'react';
import logo from '../assets/logo.png';


export default function Header(props) {
  return (
    <header className="header">
      <img src={logo} width="50"/><h1>{props.ime}</h1>
      <p>{props.slogan}</p>
      <img src={props.logo} width="40" />
    </header>
  )
}
